    useEffect(() => {
        api.get('').then((res) => console.log(res.data)).catch(e => console.log("porra"));
    }, []);
    return (
        <form action="/summoner/:summonerName" method="post">
            <input id="GET-name" type="text" name="name"/>
            <input type="submit" value={summoner} onClick={history.push(`/summoner/${summoner}`)}  />
        </form>
    )
}
